export class SignerCapability {
    account;
    constructor(fields) {
        this.account = fields.account;
    }
    toJSON() {
        return {
            account: this.account.toString(),
        };
    }
    static fromJSON(obj) {
        return new SignerCapability({
            account: obj.account,
        });
    }
    toMoveStruct() {
        return {
            account: this.account.toString(),
        };
    }
    static fromMoveStruct(obj) {
        return new SignerCapability({
            account: obj.account,
        });
    }
}
